logging.basicConfig(level=logging.INFO)

class GroundTruthGenerator:
    T: TypeVar = TypeVar('T', List[float], ndarray)
    @classmethod
    def createFileGroundTruthForEachTrial(cls, trialnum: int, startPoint: int, STEPS: int, trial: List[List[float]]) -> Tuple[int, List[bool], bool]:

        GroundTruthForEachFrame, GroundTruthForWholeFrame = cls.__returnGroundTruthForEachTrial(cls.__gatherTheCollisionOutputForAWholeFrame(startPoint, STEPS, trial)) # type: List, bool

        return trialnum, GroundTruthForEachFrame, GroundTruthForWholeFrame

    @staticmethod
    def __returnGroundTruthForEachTrial(trial: List[bool]) -> Tuple[List, bool]:

        if True in trial:
            logging.info('collision detected!')
            return trial, True
        else:
            return trial, False

    @classmethod
    def __gatherTheCollisionOutputForAWholeFrame(cls, startPoint: int, STEPS: int, trial: List[List[float]]) -> List[bool]:
        GroundTruthOnEachFrame: List = list()
        for frame in trial[1 + startPoint - STEPS:len(trial)]:
            GroundTruthOnEachFrame.append(cls.__searchForCollitionOnEachFrame(frame))
        return GroundTruthOnEachFrame


    @staticmethod
    def __searchForCollitionOnEachFrame(data: T) -> bool:
        """

        """
        trueCounter: int = 0
        for rowValue in data:
            if(float(rowValue) > 0.0):
                trueCounter += 1
            elif(float(rowValue) == 0.0):
                pass
        if(trueCounter > 0):
            return True
        elif(trueCounter == 0):
            return False


